    Button,
    Container
} from 'reactstrap';
import { Link } from '@material-ui/core';

const WorkDescription=({workDescription})=>{
    return(
        <Card className="text-center">
            <CardBody>
                <CardText>Salary : {workDescription.workAmount}</CardText>
                <CardText>Job Description: {workDescription.description}</CardText>
                <CardText>Location: {workDescription.location}</CardText>
                <CardText>Category: {workDescription.category}</CardText>
                <Link tag="a" to="/add-customer"><Button className="btn-secondary" onClick="#">Apply</Button></Link>
